let separator = {
  display: "flex", 
  width: "100%",
  height: "1px",
  backgroundColor: "#4382BC",
  margin: "8px 5px 0 5px",
}

function renderObject(selector, value, indent) {
  if (value === null) return (
    <div 
        onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
        onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
        style={{display: "flex"}}>
      <div style={{width: "50%", textIndent: `${indent*15+3}px`}}>{selector}</div>
      <div style={{width: "50%", direction: "rtl", textIndent: "5px"}}>null</div>
    </div>
  )

  if (typeof(value) === "object") {
    return (
      <div style={{cursor: "pointer"}}>
        <div 
            onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
            onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
            style={{display: "flex"}}>
          <div style={{textIndent: `${indent*15+3}px`}}>{selector}</div>
          <div style={separator}></div>
        </div>
        {function() { 
          return Object.keys(value).map((new_selector) => (
            renderObject(new_selector, value[new_selector], indent+1)
          ))
        }()}
        <div style={separator}></div>
      </div>
    )
  }
  
  else return (
    <div 
        onMouseEnter={e => {e.currentTarget.style.backgroundColor = "#b7eef5"}}
        onMouseLeave={e => {e.currentTarget.style.backgroundColor = "white"}}
        style={{display: "flex"}}>
      <div style={{width: "70%", textIndent: `${indent*15+3}px`}}>{selector}</div>
      <div style={{width: "50%", direction: "rtl", marginRight: "5px"}}>{value}</div>
    </div>
  )
}

//Extends FocusedDataList
export default function FocusedDataItem({itemObject}) {
  return Object.keys(itemObject).map((item) => (
    renderObject(item, itemObject[item], 0)
  ))  
}
